Tags are incredibly useful, but they are also incredibly restrictive. The other end of Nom's functionality is pre-written parsers that allow us to accept any of a group of characters, rather than just accepting characters in a defined sequence. Here is a selection of them: alpha0 : Recognizes zero or more lowercase and uppercase alphabetic characters: /[a-zA-Z]/. alpha1 does the same but returns at least one character alphanumeric0 : Recognizes zero or more numerical and alphabetic characters: /[0-9a-zA-Z]/. alphanumeric1 does the same but returns at least one character digit0 : Recognizes zero or more numerical characters: /[0-9]/. digit1 does the same but returns at least one character multispace0 : Recognizes zero or more spaces, tabs, carriage returns and line feeds. multispace1 does the same but returns at least one character space0 : Recognizes zero or more spaces and tabs. space1 does the same but returns at least one character line_ending : Recognizes an end of line (both \n and \r\n) newline : Matches a newline character \n tab : Matches a tab character \t We can use these in # extern crate nom;
# pub use nom::IResult;
# use std::error::Error;
pub use nom::character::complete::alpha0;
fn parser(input: &str) -> IResult<&str, &str> { alpha0(input)
} fn main() -> Result<(), Box<dyn Error>> { let (remaining, letters) = parser("abc123")?; assert_eq!(remaining, "123"); assert_eq!(letters, "abc"); # Ok(())
} One important note is that, due to the type signature of these functions, it is generally best to use them within a function that returns an IResult. If you don't, some of the information around the type of the tag function must be manually specified, which can lead to verbose code or confusing errors.

