Sometimes, we might want to choose between two parsers; and we're happy with either being used. Nom gives us a similar ability through the alt() combinator. use nom::branch::alt; The alt() combinator will execute each parser in a tuple until it finds one that does not error. If all error, then by default you are given the error from the last error. We can see a basic example of alt() below. # extern crate nom;
use nom::branch::alt;
use nom::bytes::complete::tag;
use nom::IResult;
# use std::error::Error; fn parse_abc_or_def(input: &str) -> IResult<&str, &str> { alt(( tag("abc"), tag("def") ))(input)
} fn main() -> Result<(), Box<dyn Error>> { let (leftover_input, output) = parse_abc_or_def("abcWorld")?; assert_eq!(leftover_input, "World"); assert_eq!(output, "abc"); assert!(parse_abc_or_def("ghiWorld").is_err());
# Ok(())
}

