Now that we can create more interesting regexes, we can compose them together. The simplest way to do this is just to evaluate them in sequence: # extern crate nom;
use nom::branch::alt;
use nom::bytes::complete::tag;
use nom::IResult;
# use std::error::Error; fn parse_abc(input: &str) -> IResult<&str, &str> { tag("abc")(input)
}
fn parse_def_or_ghi(input: &str) -> IResult<&str, &str> { alt(( tag("def"), tag("ghi") ))(input)
} fn main() -> Result<(), Box<dyn Error>> { let input = "abcghi"; let (remainder, abc) = parse_abc(input)?; let (remainder, def_or_ghi) = parse_def_or_ghi(remainder)?; println!("first parsed: {abc}; then parsed: {def_or_ghi};"); # Ok(())
} Composing tags is such a common requirement that, in fact, Nom has a few built in combinators to do it. The simplest of these is tuple(). The tuple() combinator takes a tuple of parsers, and either returns Ok with a tuple of all of their successful parses, or it returns the Err of the first failed parser. use nom::sequence::tuple; # extern crate nom;
use nom::branch::alt;
use nom::sequence::tuple;
use nom::bytes::complete::tag_no_case;
use nom::character::complete::{digit1};
use nom::IResult;
# use std::error::Error; fn parse_base(input: &str) -> IResult<&str, &str> { alt(( tag_no_case("a"), tag_no_case("t"), tag_no_case("c"), tag_no_case("g") ))(input)
} fn parse_pair(input: &str) -> IResult<&str, (&str, &str)> { // the many_m_n combinator might also be appropriate here. tuple(( parse_base, parse_base, ))(input)
} fn main() -> Result<(), Box<dyn Error>> { let (remaining, parsed) = parse_pair("aTcG")?; assert_eq!(parsed, ("a", "T")); assert_eq!(remaining, "cG"); assert!(parse_pair("Dct").is_err()); # Ok(())
}

