So far, we have seen mostly functions that take an &str, and return a IResult<&str, &str>. Splitting strings into smaller strings is certainly useful, but it's not the only thing Nom is capable of! A useful operation when parsing is to convert between types; for example parsing from &str to another primitive, like bool. All we need to do for our parser to return a different type is to change the second type parameter of IResult to the desired return type. For example, to return a bool, return a IResult<&str, bool>. Recall that the first type parameter of the IResult is the input type, so even if you're returning something different, if your input is a &str, the first type argument of IResult should be also. Until you have read the chapter on Errors, we strongly suggest avoiding the use of parsers built into Rust (like str.parse); as they require special handling to work well with Nom. That said, one Nom-native way of doing a type conversion is to use the value combinator to convert from a successful parse to a particular value. The following code converts from a string containing "true" or "false", to the corresponding bool. # extern crate nom;
# use std::error::Error;
use nom::IResult;
use nom::bytes::complete::tag;
use nom::combinator::value;
use nom::branch::alt; fn parse_bool(input: &str) -> IResult<&str, bool> { // either, parse `"true"` -> `true`; `"false"` -> `false`, or error. alt(( value(true, tag("true")), value(false, tag("false")), ))(input)
} fn main() -> Result<(), Box<dyn Error>> { // Parses the `"true"` out. let (remaining, parsed) = parse_bool("true|false")?; assert_eq!(parsed, true); assert_eq!(remaining, "|false"); // If we forget about the "|", we get an error. let parsing_error = parse_bool(remaining); assert!(parsing_error.is_err()); // Skipping the first byte gives us `false`! let (remaining, parsed) = parse_bool(&remaining[1..])?; assert_eq!(parsed, false); assert_eq!(remaining, ""); # Ok(())
}
